CREATE APPLICATION ships USING 4326;
CREATE SPATIAL DIMENSION Ocean (geometry: Polygon) WITH PROPERTIES (shortName String, name String);
CREATE SENSOR StationObservation (interval: 300, geometry: Point) WITH PROPERTIES (description String, name String, country String) WITH MEASUREMENT DATA (temperature Double UNITS 'ºC' ICON 'thermometer-low', salinity Double UNITS 'PSU', pressure Double UNITS 'dbar' ICON 'speedometer') WITH SPATIAL GROUP Ocean;
WITH BBOX ([42.7, -8.1], 9);

CREATE APPLICATION magist_traffic USING 4326;
CREATE SPATIAL DIMENSION Municipality (geometry: Polygon) WITH PROPERTIES (cMun Integer);
CREATE SPATIAL DIMENSION District (geometry: Polygon) WITH PROPERTIES (cDis Integer) WITH PARENT (Municipality);
CREATE SPATIAL DIMENSION Section (geometry: Polygon) WITH PROPERTIES (cSec Integer) WITH PARENT (District);
CREATE SPATIAL DIMENSION Barrio (geometry: Polygon) WITH PROPERTIES (cBarrio Integer) WITH PARENT (Section);
CREATE SENSOR StationObservation (interval: 300, geometry: Point) WITH PROPERTIES (description String, accesoAsociado Long, subarea Long, codCent String, nombre String) WITH MEASUREMENT DATA (intensidad Double UNITS 'veh/h' ICON 'network_check', velocidad Double UNITS 'km/h' ICON 'speed', ocupacion Double UNITS '%' ICON 'emoji_transportation') WITH SPATIAL GROUP Section (Section) WITH BBOX ([40.42, -3.7], 12);

CREATE APPLICATION intecmar_2 USING 4326;
CREATE SPATIAL DIMENSION Estuary (geometry: Polygon) WITH PROPERTIES (shortName String, name String, zone String);
CREATE CATEGORICAL DIMENSION Depth WITH RANGES (surface from 0 to 3, 5m from 4.75 to 5.25, 10m from 9.75 to 10.25, 15m from 14.75 to 15.25, and 20m from 19.75 to 20.25);
CREATE CATEGORICAL DIMENSION alarm;
CREATE SENSOR StationObservation (interval: 300, geometry: Point) WITH PROPERTIES (maxDepth Float, code String, name String, description String, startTime DateTime, endTime DateTime) WITH MEASUREMENT DATA (temperature_ITS90 Double UNITS 'ºC' ICON 'thermometer-low', salinity Double UNITS 'PSU', pressure Double UNITS 'dbar' ICON 'speedometer', ph Double UNITS 'ph' ICON 'ph', oxygen Double UNITS 'mg/l' ICON 'gas-cylinder', transmittance Double UNITS 'm', irradiance Double UNITS 'W/m2', uv_flourescence Double UNITS 'mg/m3', density Double UNITS 'kg/m3', conductivity Double UNITS 'S/m') WITH SPATIAL GROUP Estuary (Estuary) WITH BBOX ([42.7, -8.1], 9);

CREATE APPLICATION fuel_tanks USING 4326;
CREATE SPATIAL DIMENSION Section (geometry: Polygon) WITH PROPERTIES (shortName String);
